webpackJsonp([0xb2eb822e5e9c],{336:function(e,t){e.exports={data:{site:{siteMetadata:{author:"---",defaultTitle:"Capstone",defaultDescription:"---"}},markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 740px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 65.93059936908517%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="?"\n        title=""\n        src="/static/counsellor-3488e2853deb86530ac06663dadedf43-ee728.png"\n        srcset="/static/counsellor-3488e2853deb86530ac06663dadedf43-d6301.png 185w,\n/static/counsellor-3488e2853deb86530ac06663dadedf43-8e204.png 370w,\n/static/counsellor-3488e2853deb86530ac06663dadedf43-ee728.png 740w,\n/static/counsellor-3488e2853deb86530ac06663dadedf43-9f2bb.png 951w"\n        sizes="(max-width: 740px) 100vw, 740px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The thing about being told that the resources are there for counselling here at Ryerson is that they\'re there, but they\'re "not." I\'m not someone who wants to share my problems with someone who hardly even knows who I am. What good is talking to someone who only knows me as far as the 30 minutes we\'ve met? What good is it telling them my problems to which they respond with a generic reply that I am already aware of, simply because they can not tailor a response through a previous understanding of who I am? This sort of impersonal stuff has always been non-insightful to me; This is the "not."</p>\n<h2>Campus Link: Learning strategist</h2>\n<p>Despite this, I still keep an open mind. I met with a learning strategist to see if I could maybe, just maybe learn something new. This learning strategist was a very kind young woman, and I appreciate her time and knowledge of what she was trying to convey to me, but it was of no use simply because it was all stuff I already knew. If anything, I just liked that I had gotten it out of the way as per my probation contract. The other learning strategist across from me was wearing a Raptors hat, I wish I had chosen an appointment with him just to talk about sports. </p>\n<h2>Campus Link: Meeting with a professor during office hours</h2>\n<p>I was familiar with this professor before. I was in her seminar section just last year in the exact same class. She reached out to me last year over email when things were going south, and that, I appreciated a lot. Because of this, I took the very course with her again just this semester. I met with her during her office hours once and she had simply asked me how I have been. We got into a whole bunch of talk about life and exchanged stories; I gave her the run down of my dilemma that brought me here and she told me her journey of becoming a professor, and that she used to counsel even, which was of no surprise. It was nice to talk to her this way as it made me feel like less of a number as a student and more of a person, but I still felt like a stock character to her. She had a very generic response to my dilemma, all while preaching that there are resources at Ryerson available such as counselling if I needed it. Sorry to be so hard-headed, but no, I don\'t need it. </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 25.71428571428572%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hug"\n        title=""\n        src="/static/hug-1f1fa159388409d5e93cefdff2d864b0-959f4.png"\n        srcset="/static/hug-1f1fa159388409d5e93cefdff2d864b0-0ccff.png 185w,\n/static/hug-1f1fa159388409d5e93cefdff2d864b0-26549.png 370w,\n/static/hug-1f1fa159388409d5e93cefdff2d864b0-959f4.png 700w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  </p>\n<p>So who is "The Counsellor"?  Shortly after, on that same day that I talked to my professor, September 27th, I visited my high school. I visited for the sole purpose of talking to a guidance counsellor who has known me for nearly all of my pivotal developing life; nearly half my life even. She knows who I am and undoubtedly knows how to counsel, and I can\'t help but thank her so much for the support that she\'s given me ever since I was a young ignorant high school freshman a good decade ago. She was very thankful to see me and hear of my current struggles and thoughts. She gave me words of positive reinforcement that I\'ve kept close to my heart going forward with this semester, especially coming from someone who has seen me grow into the person I am today. To me, that is a counsellor. This has been my best academic support being a first-generation student, and continues to be given that we exchanged numbers and keep in touch.</p>\n<p>In retrospect, I don\'t think anything would have changed the situation I am in now had I gone to her sooner because more than anything, I believe it takes a great amount of time to let things sink in when a problem arises, reflect on it, then carry on with a new mindset. No amount of counselling could have helped speed this up. </p>',excerpt:"The thing about being told that the resources are there for counselling here at Ryerson is that they're there, but they're \"not.\" I'm notâ€¦",timeToRead:3,fields:{date:"October 31, 2018",slug:"/journal/the-counsellor/"},frontmatter:{title:"The Counsellor"}}},pathContext:{slug:"/journal/the-counsellor/"}}}});
